import { Navigate, NavLink, Route, Routes,Outlet } from "react-router-dom";
import Create from './Create'
import Myvotes from "./Myvotes"
export default function Main(){

  return(
    <div>
      <Routes>
    <Route path="" element={<Navigate to="/main/create"/>}/>
      <Route path="/create" element={<Create/>}/>
      <Route path="/myvotes" element={<Myvotes/>}/>
      </Routes>
<Outlet/>
      <nav>
        <NavLink to="/main/create">新建</NavLink>
        {'|'}
        <NavLink to="/main/myvotes">我的</NavLink>
      </nav>
    </div>
  )
}
